INSERT INTO `config_info` VALUES (1, 'common.yaml', 'RENREN_CLOUD_GROUP', 'spring:\n  cloud:\n    sentinel:\n      enabled: true\n      transport:\n        # sentinel dashboard 地址\n        dashboard: localhost:8180\n\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \"*\"\n  endpoint:\n    health:\n      show-details: ALWAYS\n\nfeign:\n  sentinel:\n    enabled: true\n  client:\n    config:\n      default:\n        loggerLevel: FULL\n  httpclient:\n    enabled: true\n\n\nribbon:\n  ReadTimeout: 300000\n  ConnectTimeout: 300000    ', 'e0ff4fcf43b95a579b40e9ecf0b95c3c', '2021-11-04 02:00:27', '2021-11-04 02:00:27', NULL, '58.247.201.187', '', 'tsl-integrate-test', NULL, NULL, NULL, 'yaml', NULL);
