INSERT INTO `config_info` VALUES (40, 'aisite.yaml', 'RENREN_CLOUD_GROUP', '\n\nspring:\n#  mvc:\n  #    static-path-pattern: /images/**\n  # 静态资源路径\n  resources:\n    static-locations: classpath:/META-INF/resources/,classpath:/resources/,classpath:/static/,classpath:/public/,file:/home/\n\n  servlet:\n    multipart:\n      max-file-size: 100MB\n      max-request-size: 100MB\n      enabled: true\n  redis:\n    host: 47.101.145.208\n    port: 9017\n    database: 0\n    password: Sjs.379=\n    timeout: 30s\n  datasource:\n    druid:\n      driver-class-name: org.postgresql.Driver\n      url: jdbc:postgresql://47.101.145.208:9003/test_ai_site\n      username: postgres\n      password: Sjs.379=\n      initial-size: 10\n      max-active: 100\n      min-idle: 10\n      max-wait: 6000\n      pool-prepared-statements: true\n      max-pool-prepared-statement-per-connection-size: 20\n      time-between-eviction-runs-millis: 60000\n      min-evictable-idle-time-millis: 300000\n      #Oracle需要打开注释\n      #validation-query: SELECT 1 FROM DUAL\n      test-while-idle: true\n      test-on-borrow: false\n      test-on-return: false\n      stat-view-servlet:\n        enabled: true\n        url-pattern: /druid/*\n        allow:\n        deny:\n        #login-username: admin\n        #login-password: admin\n      filter:\n        stat:\n          log-slow-sql: true\n          slow-sql-millis: 1000\n          merge-sql: false\n        wall:\n          config:\n            multi-statement-allow: true\n\n\n\n# 是否开启redis缓存  true开启   false关闭\nrenren.redis.open: false\n\n#mybatis\nmybatis-plus:\n  mapper-locations: classpath*:/mapper/**/*.xml\n  #实体扫描，多个package用逗号或者分号分隔\n  typeAliasesPackage: io.tsl.modules.*.entity\n  global-config:\n    #数据库相关配置\n    db-config:\n      #主键类型  AUTO:\"数据库ID自增\", INPUT:\"用户输入ID\", ID_WORKER:\"全局唯一ID (数字类型唯一ID)\", UUID:\"全局唯一ID UUID\";\n      id-type: ID_WORKER\n    banner: false\n  #原生配置\n  configuration:\n    map-underscore-to-camel-case: true\n    cache-enab